import './App.css';
import { Content } from './modules/Content'

function App() {
  return (
    <div className="App">
      <Content container='container'>
        <div className='row'>
            <div className='col bg-primary'>1 of 4</div>
            <div className='col bg-secondary'>2 of 4</div>
            <div className='col bg-danger'>3 of 4</div>
            <div className='col bg-info'>4 of 4</div>
        </div>
      </Content>
    </div>
  );
}

export default App;
